package com.she.env.air.model;

public class PreventFacItem {

    private int eairPreventFacChgHistNo;

    private String eairChemCd;

    private String eairChemNm;

    private String code;

    private String name;

    public int getEairPreventFacChgHistNo() {
        return eairPreventFacChgHistNo;
    }

    public String getEairChemCd() {
        return eairChemCd;
    }

    public void setEairChemCd(String eairChemCd) {
        this.eairChemCd = eairChemCd;
    }

    public String getEairChemNm() {
        return eairChemNm;
    }

    public void setEairChemNm(String eairChemNm) {
        this.eairChemNm = eairChemNm;
    }

    public void setEairPreventFacChgHistNo(int eairPreventFacChgHistNo) {
        this.eairPreventFacChgHistNo = eairPreventFacChgHistNo;
    }

    public String getCode() {
        return code;
    }

    public void setCode(String code) {
        this.code = code;
    }

    public String getName() {
        return name;
    }

    public void setName(String name) {
        this.name = name;
    }

}
